If your type owns references to other python objects, you will need to integrate with Python's garbage collector so that the GC is aware of those references. To do this, implement PyGCProtocol trait for your struct. It includes two methods __traverse__ and __clear__ . These correspond to the slots tp_traverse and tp_clear in the Python C API. __traverse__ must call visit.call() for each reference to another python object. __clear__ must clear out any mutable references to other python objects (thus breaking reference cycles). Immutable references do not have to be cleared, as every cycle must contain at least one mutable reference. Example: #![feature(specialization)] use pyo3::prelude::*; #[pyclass]
struct ClassWithGCSupport { obj: Option<PyObject>,
} #[pyproto]
impl PyGCProtocol for ClassWithGCSupport { fn __traverse__(&self, visit: PyVisit) -> Result<(), PyTraverseError> { if let Some(ref obj) = self.obj { visit.call(obj)? } Ok(()) } fn __clear__(&mut self) { if let Some(obj) = self.obj.take() { // Release reference, this decrements ref counter. self.py().release(obj); } }
} Special protocol trait implementation has to be annotated with #[pyproto] attribute. It is also possible to enable gc for custom class using gc parameter for class annotation. i.e. #[pyclass(gc)] . In that case instances of custom class participate in python garbage collector, and it is possible to track them with gc module methods.

